import React, { useEffect } from 'react'
import { Paper, Box, CircularProgress, Typography, Breadcrumbs, Link } from '@mui/material';
import { useSearchParams } from "react-router-dom";
import NavigateNextIcon from '@mui/icons-material/NavigateNext';

import { useAppSelector, useAppDispatch } from '../../app/hooks';
import { fetchProducts } from './productSlice';
import images from '../../constants/images/index';

const Products = () => {

    const [params] = useSearchParams();
    const dispatch = useAppDispatch();
    const products = Object.values(useAppSelector(state => state.products.entities));
    const categories = useAppSelector(state => state.products.categories);
    const status = useAppSelector(state => state.products.status);

    useEffect(() => {
        dispatch(fetchProducts({ product: params.get('search') || '' }));
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [params])

    let pesoARS = (currency: string) => Intl.NumberFormat("es-AR", {
        style: "currency",
        currency: currency,
        minimumFractionDigits: 0
    });

    const repetedCategories: { [key: string]: number } = ['micho', 'tito', 'tito', 'micho', 'micho', 'choto', 'tito', 'tito'].reduce((acc: { [key: string]: number }, next: string) => {
        return {
            ...acc,
            [next]: acc[next] ? (acc[next] + 1) : 1
        }
    }, {})

    const compareName = (a: number, b: number) => {

        // converting to uppercase to have case-insensitive comparison
        const name1 = a;
        const name2 = b;

        let comparison = 0;

        if (name1 < name2) {
            comparison = 1;
        } else if (name1 > name2) {
            comparison = -1;
        }
        return comparison;
    }

    const sortable = Object.entries(repetedCategories).sort(([,a],[,b]) => compareName(a,b)).reduce((r, [k, v]) => ({ ...r, [k]: v }), {});

    console.log(sortable, "SORTEABLE");

    console.log(Object.entries(repetedCategories), ' repetedCategories');

    const breadcrumbs = [
        <Typography fontSize={14} color="app.lightDark">
            Breadcrumb
        </Typography>,
        <Typography fontSize={14} color="app.lightDark">
            Breadcrumb
        </Typography>,
        <Typography fontSize={14} color="app.lightDark">
            Breadcrumb
        </Typography>,
    ];

    return (
        <Box display={'flex'} >
            {status === 'loading' && <CircularProgress size={40} color={'secondary'} />}
            {status === 'success' &&
                <Box width={'100%'}>
                    <Breadcrumbs
                        sx={{ marginTop: '16px', marginBottom: '16px' }}
                        separator={<NavigateNextIcon fontSize="small" style={{ color: '#999999' }} />}
                        aria-label="breadcrumb"
                    >
                        {breadcrumbs}
                    </Breadcrumbs>
                    <Paper elevation={0}>
                        {products.map((product, index) => (
                            <Box display={'flex'} flexDirection={'column'}>
                                <Box display={'flex'} >
                                    <img style={{ height: 180, width: 180, borderRadius: 4, margin: 16 }} src={product?.picture} alt={product?.title} />
                                    <Box display={'flex'} flexDirection={'column'}>
                                        <Box display={'flex'} alignItems={'center'} marginTop={'32px'}>
                                            <Box display={'flex'}>
                                                <Typography fontSize={24} sx={{ lineHeight: 'normal' }}>{pesoARS(product?.price.currency || 'ARS').format(product?.price.amount || 0)}</Typography>
                                                <Typography fontSize={18} >{product?.price.decimals.toString().padStart(2, '0')}</Typography>
                                            </Box>
                                            {product?.free_shipping && <Box marginLeft={'10px'}>
                                                <img style={{ width: 'auto' }} alt={`shipping - ${product?.title}`} src={images.shippig} />
                                            </Box>}
                                        </Box>
                                        <Typography fontSize={18} marginTop={'32px'}>{product?.title}</Typography>
                                    </Box>
                                </Box>
                                <Box sx={{ display: 'flex', justifyContent: 'center' }}>
                                    {index !== (products.length - 1) && <Box sx={{ height: '1px', backgroundColor: '#EEEEEEEE', marginLeft: '16px', marginRight: '16px', width: '100%' }} />}
                                </Box>
                            </Box>
                        ))}
                    </Paper>
                </Box>
            }

        </Box>
    )
}

export default Products;
